import { Pricing, type PricingPlan } from "@/registry/default/ui/pricing-01"

const customPlans: PricingPlan[] = [
  {
    name: "Basic",
    description: "Essential features for getting started",
    price: { monthly: 9, yearly: 7 },
    features: ["5 users", "50 projects", "10GB storage", "Email support"],
    cta: "Start Trial",
    highlighted: false,
  },
  {
    name: "Professional",
    description: "Advanced tools for professionals",
    price: { monthly: 49, yearly: 39 },
    features: [
      "Unlimited users",
      "Unlimited projects",
      "100GB storage",
      "Priority support",
      "Advanced analytics",
      "Custom branding",
    ],
    cta: "Get Started",
    highlighted: true,
  },
]

export default function PricingCustomDemo() {
  return (
    <div className="py-24 px-4">
      <Pricing
        plans={customPlans}
        heading="Choose your plan"
        description="Flexible pricing for teams of all sizes"
        yearlyDiscount={25}
        onPlanSelect={(plan) => console.log("Selected plan:", plan.name)}
      />
    </div>
  )
}
